Syn Skubiszewskiego opisał luki w systemie IT KBW: system WOW - Wsparcie Organów Wyborczych 

ow.org.pl/2025/04/10/oblicza… 

Clou: 

“Komisja okregowe (nadrzedne) powinny porownac protokół papierowy z tym, który jest w komputerze (obecnie Komisja nie sprawdza, czy obie wersje protokołu zawierają te same liczby, czyli uchwały PKW 63/2023 i 111/2023 nie są w praktyce wykonywane. “Najprawdopodobniej wynika to z tego, że wytyczne dla okręgowych komisji wyborczych przeczą tym uchwałom.”) 

Mamy więc taką sytuację: z jednej strony są papierowe wersje protokołów, które zostały sprawdzone i podpisane przez członków obwodowych komisji wyborczych, a z drugiej – protokoły w wersji elektronicznej, w systemie komputerowym, które służą do obliczenia wyników głosowanie. Nikt nie sprawdza, czy wersje elektroniczne i papierowe mają taką samą treść” 

WOW system można hakować/zaatakować na różne sposoby: wifi, hardware, poprzez członka komisji wprowadzającego dane. 

